import time

def solve(s):
    s = list(s)
    want = []
    for start in range(len(s)):
        for end in range(start, len(s)):
            if start <= end:
                end += 1

                # 下面就是判断回文了。
                temp = s[start: end]
                if len(want) < len(temp):
                    r = len(temp) // 2
                    if len(temp) % 2 == 1:
                        if temp[:r] == list(reversed(temp[r+1:])) and len(want) <= len(temp):
                            want = temp
                    else:
                        if temp[:r] == list(reversed(temp[r:])) and len(want) <= len(temp):
                            want = temp

                    # k = 1
                    # for m in range(len(temp) // 2 + 1):
                    #     if temp[m] == temp[-m - 1]:
                    #         k *= 1  # 此时第一次首位相等
                    #     else:
                    #         k *= 0  # 否则的话，就直接 排除掉了。
                    #         break
                    # if k != 0:
                    #     if len(want) < len(temp):
                    #         want = temp

        start += 1

    print("this is the final res: ", want)
    return ''.join(want)

# s = ""
s = ""

# s = 'caabbbd'
# s = 'babad'

t1 = time.time()
solve(s)
t2 = time.time()

print(t2 - t1)      # 2.26253342628479      # 4.23775577545166